import ChatInput from "./ChatInput";
import ChatBox from "./chatBox";

function RightSec({listMessages, setListMessages}) {
    return (
        <div className="chat-sec">
            <nav className="navbar-light px-3 sticky-sm-top chat-nav fw-bolder big-text" id="chatNav">
                AutoBot
            </nav>
            <ChatBox masseges={listMessages}/>
            <ChatInput setListMessages={setListMessages}/>
        </div>
    )
}

export default RightSec;
